import Layout from '../components/MyLayout';
import Link from 'next/link';
import useSWR from 'swr';
import fetch from 'isomorphic-unfetch';

function fetcher(url) {
  return fetch(url).then(r => r.json());
}

export default function AssetLedger() {
  // The following line has optional chaining, added in Next.js v9.1.5,
  // is the same as `data && data.name`
  const name = data?.name;
  let symbol = data?.symbol;
  let address = data?.address;

  if (!data) name = 'Loading...';
  if (error) name = 'Failed to fetch the quote.';

  console.log(`Show data fetched. Count: ${data.length}`);

  <Layout>
    <h1>Collection of Asset</h1> 
    <p>Think of a Collection of Asset as a box of toys and each asset as a toy.</p>
    <br /><hr /><br />
    <Link href="/newcollection">
      <a>Create a New Collection...</a>
    </Link>
    <br /><hr /><br />

  </Layout>
}

